import React from 'react';
import { useLocation } from 'react-router-dom';

function Page2() {
    const location = useLocation();
    const { works } = location.state || { works: [] }; // 기본값을 빈 배열로 설정

    return (
        <div>
            <h1>작품 정보</h1>
            {works.map((work, index) => (
                <div key={index}>
                    <h2>작품 제목: {work.title}</h2>
                    <p>작품 내용: {work.description}</p>
                    <p>감독명: {work.director}</p>
                    <p>배우명: {work.actors}</p>
                    <p>추가입력사항: {work.additionalInfo}</p>
                </div>
            ))}
        </div>
    );
}

export default Page2;
